import React from 'react';

const PuantageTable = ({ activities, users }) => {
  return (
    <div className="table-container">
      <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>Department</th>
            <th>Work Hours</th>
          </tr>
        </thead>
        <tbody>
          {users.map(user => (
            <tr key={user.id}>
              <td>{user.firstName} {user.lastName}</td>
              <td>{user.department}</td>
              <td>{user.workHours}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default PuantageTable;
